import React, { useEffect, useState } from 'react';
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import { Header } from '../../components/header/Header';
import { Container, Divider } from '@material-ui/core';
import { useDispatch, useSelector } from 'react-redux';
import { userService } from './../../services/user.service';
import { userActions } from './../../actions/user.actions';
import { menuActions } from '../../actions/menu.action';
import { SideBar } from './SideBar';
import { CreateNewRestaurant } from '../../components/createNewRestaurant/create'
const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1
    },
    nonePadding: {
        padding: "0!important"
    }
}));
function renderSwitch(param) {
    switch (param) {
        case 1:
            return <CreateNewRestaurant></CreateNewRestaurant>
        default:
            return 'foo';
    }
}

export function Restaurant(props) {
    const classes = useStyles();
    const [menu, setMenu] = useState();
    return (
        <Container>
            <Grid container spacing={3} >
                <Grid item xs={12} className={classes.nonePadding}>
                    <Header></Header>
                </Grid>
                <Grid container style={{ marginTop: "100px" }}>
                    <Grid container>
                        <Grid xs={3}>
                            <SideBar menu={menu} setMenu={setMenu}></SideBar>
                        </Grid>
                        <Grid xs={9}>
                            {
                                renderSwitch(menu)
                            }
                        </Grid>

                    </Grid>
                </Grid>
            </Grid>
        </Container >
    );
}
